met Mark Wahlberg, Mila Kunis en Beau Bridges

De doorgewinterde DEA agent Max Payne (Mark Wahlberg) moet een serie gruwelijke moorden in New York zien op te lossen. Hij wordt 
daarbij geholpen door de beeldschone Mona Sax (Mila Kunis). Zij heeft een appeltje te schillen met de moordenaar van haar zus. 
Wat begint als een simpele moordzaak, verandert al snel in een nachtmerrie. Niet alleen de maffia, maar ook een meedogenloos 
bedrijf zit achter het tweetal aan.
